import React from 'react';
import Service from './ServicesApi';

const Card = () => {
  return (
    <>

      {Service.map((currElem, id) => {
        return (
          <>
            <div className="card">
              <img src={currElem.img} className="card-img-top" alt="..." />
              <div className="card-body">
                <h5 className="card-title">{currElem.name}</h5>
                <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                <a href="#" className="btn btn-primary">{currElem.btn}</a>
              </div>
            </div>

          </>
        )
      })}

    </>
  )
}

export default Card;
